import React, { useState, useEffect } from 'react';
import { Link, useParams } from 'react-router-dom';

export default function CardList() {
    const [ cardList, setCardList] = useState([]);
    const { deckId } = useParams();

    useEffect(() => {
        listCards()
        .then(setCardList)
    },[deckId])
}
